function FormComponent(formValues, setFormVals, setIdeas) {

    return (
        <form>
            <input defaultValue={"default val"}></input>
            <select>
                <option> option1</option>
                <option> option2</option>
                <option> option3</option>
                <option> option4</option>
            </select>
            <SubmitEvent>setIdeas</SubmitEvent>
        </form>
    )

}
